/**
 * Returns the ShareCredentialPopup component which is the modal that enables the sharing
 * of a specified credential.
 * @param {Object} theme - To receive the theme from the CustomThemeProvider component.
 * @param {Function} closePopupFunc - The function to close this popup.
 * @param {Function} goBackFunc - The function to hide this component
 * and show the ViewVerifiedCredentialPopup component.
 * @param {Object} credential - The credential to be shared.
 * @param {Function} showShareQrPopupFunc - The function to
 * hide this component and show the ShareQrPopup component.
 * @param {Function} showShareNfcPopupFunc - The function to
 * hide this component and show the ShareNfcPopup component.
 * @returns {ReactElement} - The ShareCredentialPopup component.
 */
const ShareCredentialPopup = ({theme, closePopupFunc, goBackFunc, credential, showShareQrPopupFunc, showShareNfcPopupFunc}) => {
    const popupRef = useRef(null);
    const [shareMethod, setShareMethod] = useState('QR')
    /**
     * Function to set the credential sharing method.
     */
    const toggleShareMethod = () => {
        if(shareMethod === "QR")
            setShareMethod("NFC");
        else
            setShareMethod("QR");
    }
    /**
     * Closes the popup when clicked outside of it.
     * @param {Event} e - The click event which is fired when the user clicks
     * outside the popup.  
     */    
    const handleClickOutside = e => {
            if (popupRef.current && !popupRef.current.contains(e.target)) {
            closePopupFunc();
        }
    }

    return (
        <BlurredBg onMouseDown={handleClickOutside}>
            <Popup ref={popupRef}>
                <BreadcrumbHeader>
                    <ClosePopup>
                        <ArrowLeft stroke={theme.mainColors.grey} onClick={goBackFunc} width="2rem" />
                    </ClosePopup>
                    <H1>Share Credential</H1>
                </BreadcrumbHeader>
                <Note>
                    You are about to share the following credential:
                </Note>
                <Hr />
                <CredentialGeneralInfo>
                    <div>
                        {placeholderImg}
                    </div>
                    <RegAuthority>{credential.regAuthority}</RegAuthority>
                    <CredentialName>{credential.credentialName}</CredentialName>
                </CredentialGeneralInfo>
                <Hr />
                <ChooseMethod>
                   <div className="instructions">
                        Choose your sharing method.
                   </div>
                   <div className="switch">
                       <div className={shareMethod === "QR" ? "active" : "inactive"}>
                           QR
                       </div>
                       <div>
                            <ToggleSwitch
                                bgColorOn={theme.mainColors.blue}
                                bgColorOff={theme.mainColors.blue}
                                btnColorOn={theme.mainColors.white}
                                btnColorOff={theme.mainColors.white}
                                isOn={shareMethod === "NFC"}
                                onToggle={toggleShareMethod}
                            />
                       </div>
                       <div className={shareMethod === "NFC" ? "active" : "inactive"}>
                           NFC
                       </div>
                   </div>
                </ChooseMethod>
                <Hr />
                <BtnDiv>
                    <Button 
                        primary 
                        btnColor={theme.btnPriBg}
                        onClick={() => {
                                if(shareMethod === "QR")
                                    showShareQrPopupFunc();
                                else
                                    showShareNfcPopupFunc();
                            }
                        }
                    >
                        SHARE CREDENTIAL
                    </Button>
                </BtnDiv>
            </Popup>
        </BlurredBg>
    )
}

export default withTheme(ShareCredentialPopup)

